    return (
        <div className="header">
            <Box className="header-content" >
        <Typography>כלי לבדיקת מספרי טלפון מול מאגר ״אל תתקשר אליי״</Typography>
        <div className="nav">

        <Button className="app-button" variant="outlined">הנחיות החוק
       <IconButton>
        <HelpOutline fontSize="medium" />
  </IconButton>
הנחיות החוק
  </Button>

        <Button className="app-button" variant="outlined">הגדרת פרטי עסק</Button>
        </div>
        </Box>
         </div>
    );
}

export default Header;
